    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE ( - col1 * - col0 * - col0 ) NOT IN ( 7, col2, + 66, + col2, col1 );
  - name: tab2

outputs:
  - name: q9074.out
    data: |
      46	51	23
      64	77	40
      75	67	58
